			<div className={Styles.GridBox}></div>
			<div className={Styles.GridBox}></div>
			<div className={Styles.GridBox}></div>
			<div className={Styles.GridBox}></div>
			<div className={Styles.GridBox}></div>
			<div className={Styles.GridBox}></div>
			<div className={Styles.GridBox}></div>
			<div className={Styles.GridBox}></div>
		</div>
	);
}
